Add-Type -AssemblyName System.Windows.Forms
Add-Type -AssemblyName System.Drawing

# == EMBEDDED BANNER BASE64 ==
$bannerBase64 = @"

"@.Trim()

# === Convert to image ===
$bannerBytes = [Convert]::FromBase64String($bannerBase64)
$bannerStream = New-Object System.IO.MemoryStream(,$bannerBytes)
$bannerImage = [System.Drawing.Image]::FromStream($bannerStream)

# == MAIN FORM ==
$form = New-Object System.Windows.Forms.Form
$form.Text = "PimpMyWindows - HoneyBadger Edition"
$form.Size = New-Object System.Drawing.Size(500, 320)
$form.StartPosition = "CenterScreen"
$form.BackColor = [System.Drawing.Color]::FromArgb(30,30,30)
$form.FormBorderStyle = "FixedDialog"
$form.MaximizeBox = $false

# Optional: Set app icon (if needed)
# $iconBytes = [Convert]::FromBase64String("<your-icon-base64>")
# $form.Icon = New-Object System.Drawing.Icon((New-Object IO.MemoryStream(,$iconBytes)))

# == Banner ==
$bannerBox = New-Object System.Windows.Forms.PictureBox
$bannerBox.Image = $bannerImage
$bannerBox.Size = New-Object System.Drawing.Size(460,80)
$bannerBox.Location = New-Object System.Drawing.Point(20,20)
$bannerBox.SizeMode = 'StretchImage'
$form.Controls.Add($bannerBox)

# == Secure Mode Button ==
$secureButton = New-Object System.Windows.Forms.Button
$secureButton.Text = "Secure Mode"
$secureButton.Size = New-Object System.Drawing.Size(140,40)
$secureButton.Location = New-Object System.Drawing.Point(50,120)
$secureButton.BackColor = [System.Drawing.Color]::Blue
$secureButton.ForeColor = [System.Drawing.Color]::White
$secureButton.Add_Click({
    [System.Windows.Forms.MessageBox]::Show("Secure Mode launched.")
})
$form.Controls.Add($secureButton)

# == Tradecraft Mode Button ==
$tradecraftButton = New-Object System.Windows.Forms.Button
$tradecraftButton.Text = "Tradecraft Mode"
$tradecraftButton.Size = New-Object System.Drawing.Size(140,40)
$tradecraftButton.Location = New-Object System.Drawing.Point(290,120)
$tradecraftButton.BackColor = [System.Drawing.Color]::Red
$tradecraftButton.ForeColor = [System.Drawing.Color]::White
$tradecraftButton.Add_Click({
    [System.Windows.Forms.MessageBox]::Show("Tradecraft Mode launched.")
})
$form.Controls.Add($tradecraftButton)

# == Exit Button ==
$exitButton = New-Object System.Windows.Forms.Button
$exitButton.Text = "Exit"
$exitButton.Size = New-Object System.Drawing.Size(100,30)
$exitButton.Location = New-Object System.Drawing.Point(195,190)
$exitButton.BackColor = [System.Drawing.Color]::FromArgb(45,45,45)
$exitButton.ForeColor = [System.Drawing.Color]::White
$exitButton.Add_Click({ $form.Close() })
$form.Controls.Add($exitButton)

# == Show Form ==
$form.Add_Shown({ $form.Activate() })
[void]$form.ShowDialog()
